import "./style.css"
const GifyModel= (props)=>{
 console.log(props.data);
    return(
        <div className= "gify_container">
            <input className="gify_inp" onClick={(e)=>{
              if(e.curretTarget.value)
              props.fn(e.curretTarget.value);
            }}/>
            
            {
              props.data.forEach((el)=>{

                return(
                  <div className="tgs_gify">
                    <img src = {el.images.original.url}></img>
                  </div>
                )
              })
            }
         
        </div>
    )
}

export default GifyModel;
